import { Layout, Typography, Row, Col, Statistic, Button, Card } from "antd";
import React, { useState, useEffect } from 'react';
import { Column } from '@ant-design/charts';
const { Title } = Typography;
const { Content } = Layout;
const [data, setData] = useState([]);
  useEffect(() => {
    asyncFetch();
  }, []);
  const asyncFetch = () => {
    fetch('https://gw.alipayobjects.com/os/antfincdn/iPY8JFnxdb/dodge-padding.json')
      .then((response) => response.json())
      .then((json) => setData(json))
      .catch((error) => {
        console.log('fetch data failed', error);
      });
  };
  var config = {
    data: data,
    isGroup: true,
    xField: '月份',
    yField: '月均降雨量',
    seriesField: 'name',
    dodgePadding: 2,
    intervalPadding: 20,
    label: {
      position: 'middle',
      layout: [
        { type: 'interval-adjust-position' },
        { type: 'interval-hide-overlap' },
        { type: 'adjust-color' },
      ],
    },
  };
const TrangChu = () => {
  return (
    <Layout>
      <Content>
        <div>
          <Title level={2}>Trang Chủ</Title>
        </div>

        <Row>
          <Col span="10">
            <Row>
              <Card
                title="Default size card"
                style={{ width: 400 }}
              >
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic title="Active Users" value={112893} />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Account Balance (CNY)"
                      value={112893}
                      precision={2}
                    />
                  </Col>
                   
                </Row>
              </Card>
            </Row>
            <br/>
            <Row>
            <Card
                title="Default size card"
                style={{ width: 800 }}
              >
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic title="Active Users" value={112893} />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Account Balance (CNY)"
                      value={112893}
                      precision={2}
                    />
                  </Col>
                </Row>
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic title="Active Users" value={112893} />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Account Balance (CNY)"
                      value={112893}
                      precision={2}
                    />
                  </Col>
                </Row>
              </Card>
            </Row>
          </Col>
          <Col span="14">
          <Column {...config} />
          </Col>
        </Row>
      </Content>
    </Layout>
  );
};
export default TrangChu;
